INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-416.5, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 62, 1000001, 1, "2025/01/31 12:00:00", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 2, 1, 3.414);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-416.5, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 62, 1000002, 1, "2025/01/31 12:00:00", "ミッションをクリアして、\n報酬をゲットしましょう！", 2, 2, 1, 3.099);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-416.5, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 63, 1000003, 1, "2025/01/31 12:00:00", "受け取ることができる\n報酬があるようです\n確認してみてください", 3, 2, 1, 2.801);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-416.5, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 63, 1000004, 2, "2025/01/31 12:00:00", "報酬がもらえますよ！\nチェックしてみてください", 4, 2, 1, 0.0);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-363.0, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 64, 1000005, 2, "2025/01/31 12:00:00", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, 1, 1, 2.12);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-363.0, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 64, 1000006, 1, "2025/01/31 12:00:00", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, 2, 1, 1.68);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-363.0, "2030/01/01 14:59:59", 0.0, "カリン", 190801, 64, 1000007, 2, "2025/01/31 12:00:00", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, 1, 1, 2.33);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", -6.0, "ラビリスタ", 133701, 61, 1020101, 3, "2025/01/31 12:00:00", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, 7, 10201, 5.18);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", -2.0, "クリスティーナ", 133901, 61, 1020102, 1, "2025/01/31 12:00:00", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, 2, 10201, 8.77);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "ネネカ", 133801, 61, 1020103, 6, "2025/01/31 12:00:00", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, 1, 10201, 15.5);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "ランファ", 134301, 61, 1020201, 2, "2025/02/28 12:00:00", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, 5, 10202, 9.061);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "チカ", 134401, 61, 1020202, 1, "2025/02/28 12:00:00", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, 2, 10202, 7.699);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "アオイ", 134601, 61, 1020301, 1, "2025/03/31 12:00:00", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, 2, 10203, 8.595);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "クローチェ", 134501, 61, 1020302, 1, "2025/03/31 12:00:00", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, 2, 10203, 7.758);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "ルイズマリー", 132302, 61, 1020401, 2, "2025/04/30 12:00:00", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, 6, 10204, 7.0);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "イロハ", 132402, 61, 1020402, 1, "2025/04/30 12:00:00", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, 2, 10204, 7.904);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "ソノ", 132502, 61, 1020403, 4, "2025/04/30 12:00:00", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, 2, 10204, 8.487);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "カノン", 134901, 61, 1020502, 1, "2025/05/31 12:00:00", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, 2, 10205, 8.763);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-285.0, "2030/01/01 14:59:59", 0.0, "ツムギ", 134801, 61, 1020503, 1, "2025/05/31 12:00:00", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, 3, 10205, 6.417);
